    value: 'January 6, 2009    Mr. Daniel Buckley  Federal Election Commission  Washington,
      DC 20463    Re:  October Monthly (9/1/08 to 9/30/08) Filed 10/20/08    Dear
      Mr. Buckley:    In responding to your letter dated December 5, 2008, regarding
      the October Monthly report, we have reviewed report and submit the following
      explanations for the items mentioned below:    Year to Date totals have been
      reviewed and corrected.    We have reviewed all transfers from our non-federal
      account for allocated activity for the period indicated and have complied with
      the 70-day time period, having transferred funds no more than 10 days before
      or 60 days after the payments to the vendors.  The amount of $294,684.62 in
      non federal transfers made during the period of July through September, 2008,
      is less  than the total portion of non federal allocated expenditures paid  from
      May through August in the amount of $351,849.88.  Therefore, the Party transferred
      less than it could have transferred.    The transfer from John Cornyn, Inc.
      memo has been changed to indicate that this is a transfer from the committee.    Schedule
      L-B has been corrected to disclose the transfer of $10,188 received from the
      Levin account.    Respectfully submitted, Wayne Tucker, Treasurer'
